    borderRadius:15,
    width:Dimensions.get('window').width - 40,
    padding:15,
    marginTop:15,
  },
  title:{
    //backgroundColor:'#fff',
    fontSize:24,
    fontWeight:"bold",
    textAlign:"center",
    paddingBottom:10,
    paddingTop:10,
    width:Dimensions.get('window').width - 40,
    borderRadius:15,
    marginTop:15,
    color:'#fff',
  },
  megjegyzes:{
    fontSize:16
  }
});
export {phoneStyles};
